import React, { ReactNode } from 'react';
import ReactDOM from 'react-dom';

class Item {
  text:string;
  id:number;
  constructor(public str:any, public iden:any){
    this.text=str;
    this.id=iden;
  }
}
class Statement{
  items: Array<Item>;
  text:string;
  constructor(public arr: Array<Item>, public str:string){
    this.items=arr;
    this.text=str;
  }
}

interface Props {
  width:  number | null | string;
  height: number | null | string ;
  value:  number;
  max:    number;
  min:    number | null;
  text:   CallableFunction;
}

export class ProgressBar extends React.Component<Props,object> {
  static defaultProps={
    width : 'inherit',
    height : 'inherit',
    min : 0,

  };

  constructor(props : any) {
    super(props);
  }

  render() {
    const pBstyle={
      width : this.props.width?.toString(),
      height : this.props.height?.toString(),
    };
    const pVstyle={
      width : this.props.value+'%',
      height : this.props.height?.toString(),
      backgroundColor : 'green'
    };
    return (

        <div style={pBstyle} >
          <div style={pVstyle}></div>
          <p>{this.props.text}</p>
        </div>

    );
  }
}


export default ProgressBar;
